In June 2024, we submitted an analysis of publication and document types in OpenAlex in comparison with the proprietary databases Web of Science and Scopus and the open data sources Semantic Scholar and PubMed (Haupka et al. 2024).
We found substantial differences between these databases: While Web of Science and Scopus provided a comprehensive set of document types to describe works published in journals, OpenAlex supported only a comparably limited number of types.
Notably, OpenAlex lacked a distinction between research articles and reviews, which can be crucial when calculating citation indicators.
In line with related studies (Alperin et al. 2024), we also observed discrepancies in the number of publications when restricting to certain document types.
Meanwhile, in late May and late July 2024, OpenAlex introduced extended approaches to obtain publication and document types.
Among the four new categories were preprints and reviews. Using PubMed, OpenAlex identified approximately 4 million journal articles as editorials, erratum, letters, preprints, reviews, or retractions.
Of course, we wanted to know how these improvements affect our findings.
We therefore re-applied our approach to the recent changes.
Using works published in journals between 2012 and 2022, we demonstrate that OpenAlex’s recent changes provide a more nuanced set of document types to refine scholarly works.
However, the comparison with Web of Science and Scopus reveals that there remain considerable differences.
Data and Methods
Following our preprint, we performed a pairwise comparison of journal publications indexed in OpenAlex with the Web of Science and Scopus published 2012 to 2022.
To investigate changes made in OpenAlex, we furthermore compared data from the OpenAlex July 2024 and August 2023 snapshots.
Scopus and Web of Science data were retrieved from the German Competence Network of Bibliometrics, using the April 2024 snapshots.
Web of Science data retrieval comprised the Core Collection.
We matched items between the databases by DOI after normalisation to lowercase.
Overall, the intersection of OpenAlex and Scopus covered 24,704,172 and the intersection of OpenAlex and Web of Science covered 21,775,771 records.
Then, we categorised works based on their document type information into two categories: research discourse and editorial discourse.
The research discourse category now also includes publications of type “preprint”, which was added to OpenAlex in May 2024.
The mapping tables used for reclassifying the document types can be found in the appendix of Haupka et al. (2024).
Findings
Figure 1 illustrates OpenAlex document type changes in comparison with Scopus.
Before the introduction of the more nuanced set of document types, OpenAlex tagged
24,559,634 items (99.42%) as articles, which reduced to 22,132,347 (89.59%).
Scopus tagged 20,777,473 items (84.11%) as article.
OpenAlex assigned the type review to 1,511,172 items (6.12%), whereas Scopus to 1,776,555 items (7.19%).



