Figure 1: Comparison of OpenAlex and Scopus for publication years 2012-2022



Figure 2 illustrates the same for the comparison of OpenAlex with Web of Science.
Here, OpenAlex tagged 21,673,833 items (99.53%) as articles before the introduction of the more nuanced set of document types and 19,500,710 (89.55%) after.
In Web of Science 17,266,997 items (79.29%) were tagged as articles.
The document type review is assigned to 1,362,290 items (6.26%) by OpenAlex, whereas Web of Science tagged 1,242,472 items (5.71%) as such.



